import { useState, useEffect } from "react";

const Mybilling = () => {
  let [Customers, customerlist] = useState([]);
  let [Products, productlist] = useState([]);

  const getallcustomer = () => {
    let url =
      "http://localhost:9999/customer/" + localStorage.getItem("tokenid");
    fetch(url)
      .then((responsedata) => responsedata.json())
      .then((response) => {
        customerlist(response);
        console.log(Customers);
      });
  };

  const getallproduct = () => {
    let url = "http://localhost:9999/product";
    fetch(url)
      .then((responsedata) => responsedata.json())
      .then((response) => {
        productlist(response);
      });
  };

  useEffect(() => {
    getallcustomer();
    getallproduct();
  }, [1]);

  let [name, pickName] = useState("paritosh");
  let [email, pickEmail] = useState("");
  let [mobile, pickMobile] = useState("");
  let [city, pickCity] = useState("");
  let [pincode, pickPincode] = useState("");
  let [address, pickAddress] = useState("");

  const printCustomer = (cinfo) => {
   
    pickName(cinfo.name);
    pickEmail(cinfo.email);
    pickMobile(cinfo.mobile);
    pickCity(cinfo.city);
    pickPincode(cinfo.pincode);
    pickAddress(cinfo.address);
  };

  const printProduct = (pinfo) => {
    console.log(pinfo);
  };

  return (
    <div className="container mt-5">
      <div className="row">
        <div className="col-lg-12 text-center">
          <h2 className="text-primary"> Billing Management </h2>
        </div>

        <div className="col-lg-2">
          <label> Select Customer</label>
          <select className="form-select">
            <option> Choose </option>
            {Customers.map((customer, index) => {
              return (
                <option
                  key={index}
                  onClick={printCustomer.bind(this, customer)}
                >
                  {" "}
                  {customer.name}{" "}
                </option>
              );
            })}
          </select>
        </div>

        <div className="col-lg-2">
          <label> Select Product</label>
          <select className="form-select">
            <option> Choose </option>
            {Products.map((product, index) => {
              return (
                <option key={index} onClick={printProduct.bind(this, product)}>
                  {" "}
                  {product.name}{" "}
                </option>
              );
            })}
          </select>
        </div>

        <div className="col-lg-2">
          <label> Enter Quantity </label>
          <input type="number" className="form-control" />
        </div>

        <div className="col-lg-2">
          <label> Total Price </label>
          <input type="number" className="form-control" />
        </div>

        <div className="col-lg-3 pt-4 text-center">
          <button className="btn btn-danger"> Generate Bill </button>
        </div>
      </div>

      <div className="row mt-2 mb-2 text-primary">
        <p className="col-lg-2">{name}</p>
        <p className="col-lg-2"> {mobile} </p>
        <p className="col-lg-2"> {email} </p>
        <p className="col-lg-2"> {city} </p>
        <p className="col-lg-2"> {pincode} </p>
        <p className="col-lg-2"> {address} </p>
      </div>
    </div>
  );
};

export default Mybilling;
